import styled from 'styled-components'

export const IncludedWrapper = styled.div`
    display: flex;
    justify-content: center;

`;

export const IncludedTitle = styled.h1`
    &:before{
        content: "";
        position: absolute;
        margin-top: 10px;
        width: 50%;
        height: 1px;
        left: 25%;
        border-bottom: 1px solid black;
    }

`;
